description:
Category Feature, Parody / Spoof 

Director Axel Braun 
Starring Kristen Price, Samantha Ryan, Skin Diamond, Billy Glide, Barry Scott, Ryan Driller, Sasha Knox, Kendall Karson 

Say goodbye to the dorky, fumbling Clark Kent of the '70s... Ryan Driller reprises the role that launched his career, but in his latest epic spoof, legendary director Axel Braun gives us an updated version of the classic all-American superhero. After a freak accident in which he kills Livewire, Clark leaves Lois, burns his costume and goes back to Smallville to rekindle his romance with Lana Lang. 


